import "./App.css";
import {
  Header,
  NewsBanner,
  TaskForm,
  TaskBar,
  Login,
} from "./Components/index";
import { Routes, Route } from "react-router-dom";
import { useEffect, useState } from "react";
function App() {
  const [x, setX] = useState();
  useEffect(() => {
    setX()
  }, []);
x=3
  setTimeout(() => { 
    x=7
  }, 1000)
 

  return (
    <div className="App">
      <Routes>
        <Route
          path="/"
          element={
            <>
              <Header />
              <NewsBanner />
              <TaskForm />
            </>
          }
        />
        <Route path="/addtask" element={<TaskBar />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
